import React from "react";
import stars from "./assets/stars.webp";
import WaviyComponent from "./Animation";

const Home = () => {

  return (
<>
<div className="parent">
    <img src={stars} id="main-img"/>
<WaviyComponent/>

<div className="headings">
<h1 className="heading-1">Rishav <span className="caste">Sachdeva</span></h1>
<h2 className="heading-2"><span className="caste">Aspiring</span> Student</h2>
<h5 className="quote">"Never stop chasing your dreams."</h5>
</div>
</div>

</>

  );
};


export default Home;
